import * as UTILS from "./utils";

class Node {

	constructor(val) {
		this.value=val;
		this.left=this.right=null;
	}

	get value() { return this.value; }
	get left()  { return this.left; }
	get right() { return this.right; }
	set left( child ) { this.left = child; }
	set right( child ) { this.right = child; }

	*postorder(){ //DFS
		if ( this.left !== null ) { yield* this.left; }
		if ( this.right !== null ) { yield* this.right; }
		yield this.value;
	}

	*inorder(){
		if ( this.left !== null ) { yield* this.left; }
		yield this.value;
		if ( this.right !== null ) { yield* this.right; }
	}

	*preorder() {
		yield this.value;
		if ( this.left !== null ) { yield* this.left; }
		if ( this.right !== null ) { yield* this.right; }
	}
}


class BinaryTree {

	constructor( value ) {
		if ( value ) {
			this.root = new Node( value );
		}
	}

	find( val ) {
		if ( val === undefined ) return null;

		const nodeCompare = val instanceof Node;
		const valCompare = ! nodeCompare;
		for( const n of this.DFS() ) {
			if ( (nodeCompare && n === val) || (valCompare && n.value === val) ) {
				return n;
			}
		}
		return null;
	}

	addLeft( parent, val ){
		if( !parent ) { return null; }

		let parNode = this.find(parent);
		if ( val instanceof Node && this.find(val) !== null ){
			throw "Cant add pre-existing node in tree.";
		}

		if ( parNode && parNode.left() === null ){
			const valNode = new Node( val );
			parNode.setLeft( valNode );
			return valNode;
		}
	}

	addRight( parent, val ){
		if( !parent ) { return null; }

		let parNode = this.find(parent);
		if ( val instanceof Node && this.find(val) !== null ){
			throw "Cant add pre-existing node in tree.";
		}

		if ( parNode && parNode.right() === null ){
			const valNode = new Node( val );
			parNode.setRight( valNode );
			return valNode;
		}
		return false;
	}

	*BFS( root=this.root ){
		let bfs=[ root ];
		for (let last=0, current=bfs[last]; current ; ++last, current = bfs[ last ]){
			yield current.value();
			if(current.left) { bfs.push(current.left()); }
			if(current.right) { bfs.push(current.right()); }
		}
	}

	*DFS( root = this.root ) {
		yield* root.postorder();
	}

}


function test(){
	let arr=UTILS.makeArray(true);
	let tree=new BinaryTree("ROOT" );
	tree.addLeft("ROOT", "fruits"); 	tree.addRight("ROOT", "veggies");

	tree.addLeft("fruits", "apple"); tree.addRight("fruits", "orange");
	tree.addLeft("veggies", "broccolli"); tree.addRight("veggies", "carrot");
	for( const v of tree.DFS() ) {
		console.log( v );
	}
}

test();

